import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Box,
  Grid,
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Chip,
  CircularProgress,
  Alert,
} from '@mui/material';
import { Search, FilterList } from '@mui/icons-material';
import ExerciseCard from '../components/ExerciseCard';
import { Exercise } from '../types';
import { exerciseApi } from '../services/api';

const ExerciseLibrary: React.FC = () => {
  const [exercises, setExercises] = useState<Exercise[]>([]);
  const [filteredExercises, setFilteredExercises] = useState<Exercise[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [searchTerm, setSearchTerm] = useState('');
  const [typeFilter, setTypeFilter] = useState<number | ''>('');
  const [difficultyFilter, setDifficultyFilter] = useState<number | ''>('');
  const [locationFilter, setLocationFilter] = useState<number | ''>('');

  useEffect(() => {
    fetchExercises();
  }, []);

  useEffect(() => {
    filterExercises();
  }, [exercises, searchTerm, typeFilter, difficultyFilter, locationFilter]);

  const fetchExercises = async () => {
    try {
      const data = await exerciseApi.getAll();
      setExercises(data);
    } catch (err: any) {
      setError('Failed to load exercises');
    } finally {
      setLoading(false);
    }
  };

  const filterExercises = () => {
    let filtered = exercises;

    // Search filter
    if (searchTerm) {
      filtered = filtered.filter(exercise =>
        exercise.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
        exercise.description.toLowerCase().includes(searchTerm.toLowerCase()) ||
        exercise.muscleGroups.some(muscle => 
          muscle.toLowerCase().includes(searchTerm.toLowerCase())
        )
      );
    }

    // Type filter
    if (typeFilter !== '') {
      filtered = filtered.filter(exercise => exercise.type === typeFilter);
    }

    // Difficulty filter
    if (difficultyFilter !== '') {
      filtered = filtered.filter(exercise => exercise.difficulty === difficultyFilter);
    }

    // Location filter
    if (locationFilter !== '') {
      filtered = filtered.filter(exercise => exercise.location === locationFilter);
    }

    setFilteredExercises(filtered);
  };

  const handleStartExercise = (exercise: Exercise) => {
    // TODO: Navigate to exercise session or log exercise
    console.log('Starting exercise:', exercise.name);
  };

  const handleViewDetails = (exercise: Exercise) => {
    // TODO: Open exercise details modal or navigate to details page
    console.log('Viewing details for:', exercise.name);
  };

  const clearFilters = () => {
    setSearchTerm('');
    setTypeFilter('');
    setDifficultyFilter('');
    setLocationFilter('');
  };

  if (loading) {
    return (
      <Container>
        <Box display="flex" justifyContent="center" alignItems="center" minHeight="400px">
          <CircularProgress />
        </Box>
      </Container>
    );
  }

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Exercise Library
      </Typography>

      {error && (
        <Alert severity="error" sx={{ mb: 3 }}>
          {error}
        </Alert>
      )}

      {/* Search and Filters */}
      <Box sx={{ mb: 4 }}>
        <Grid container spacing={2} alignItems="center">
          <Grid item xs={12} md={4}>
            <TextField
              fullWidth
              placeholder="Search exercises..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              InputProps={{
                startAdornment: <Search sx={{ mr: 1, color: 'action.active' }} />,
              }}
            />
          </Grid>

          <Grid item xs={12} md={2}>
            <FormControl fullWidth>
              <InputLabel>Type</InputLabel>
              <Select
                value={typeFilter}
                onChange={(e) => setTypeFilter(e.target.value as number)}
                label="Type"
              >
                <MenuItem value="">All Types</MenuItem>
                <MenuItem value={1}>Cardio</MenuItem>
                <MenuItem value={2}>Strength</MenuItem>
                <MenuItem value={3}>Flexibility</MenuItem>
              </Select>
            </FormControl>
          </Grid>

          <Grid item xs={12} md={2}>
            <FormControl fullWidth>
              <InputLabel>Difficulty</InputLabel>
              <Select
                value={difficultyFilter}
                onChange={(e) => setDifficultyFilter(e.target.value as number)}
                label="Difficulty"
              >
                <MenuItem value="">All Levels</MenuItem>
                <MenuItem value={1}>Beginner</MenuItem>
                <MenuItem value={2}>Intermediate</MenuItem>
                <MenuItem value={3}>Advanced</MenuItem>
              </Select>
            </FormControl>
          </Grid>

          <Grid item xs={12} md={2}>
            <FormControl fullWidth>
              <InputLabel>Location</InputLabel>
              <Select
                value={locationFilter}
                onChange={(e) => setLocationFilter(e.target.value as number)}
                label="Location"
              >
                <MenuItem value="">All Locations</MenuItem>
                <MenuItem value={1}>Home</MenuItem>
                <MenuItem value={2}>Gym</MenuItem>
                <MenuItem value={3}>Outdoor</MenuItem>
              </Select>
            </FormControl>
          </Grid>

          <Grid item xs={12} md={2}>
            <Chip
              label="Clear Filters"
              onClick={clearFilters}
              onDelete={clearFilters}
              deleteIcon={<FilterList />}
              variant="outlined"
            />
          </Grid>
        </Grid>
      </Box>

      {/* Results */}
      <Typography variant="h6" gutterBottom>
        {filteredExercises.length} exercise{filteredExercises.length !== 1 ? 's' : ''} found
      </Typography>

      <Grid container spacing={3}>
        {filteredExercises.map((exercise) => (
          <Grid item xs={12} sm={6} md={4} key={exercise.id}>
            <ExerciseCard
              exercise={exercise}
              onStartExercise={handleStartExercise}
              onViewDetails={handleViewDetails}
            />
          </Grid>
        ))}
      </Grid>

      {filteredExercises.length === 0 && !loading && (
        <Box textAlign="center" py={4}>
          <Typography variant="h6" color="text.secondary">
            No exercises found matching your criteria
          </Typography>
          <Typography variant="body2" color="text.secondary">
            Try adjusting your search terms or filters
          </Typography>
        </Box>
      )}
    </Container>
  );
};

export default ExerciseLibrary;
